import React from 'react';
import styled from 'styled-components';
import colors from '../constants/colors';

const StyledDiv = styled.div`
    width: 100%;
    height: 80vh;
    display: flex;
    justify-content: center;
    align-items: center;

    h1 {
        font-size: 25px;
        color: ${colors.text};
        font-weight: bold;
    }
`;

const NotFoundPage = () => (
    <StyledDiv>
        <h1>404 Page not found</h1>
    </StyledDiv>
);

export default NotFoundPage;
